import React from "react"
import Link from "next/link"

import 'bootstrap/dist/css/bootstrap.min.css';


import {
 Button
} from "reactstrap"

class Layout extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Button color="danger">Danger!</Button>
        );
    }
}

export default Layout;
